import React from 'react';
import logo from '../assets/styles/Header_image/Logo.png';
import myImage from '../assets/styles/Header_image/myimage.png';

const Header: React.FC = () => {
  return (
    <header className="header">
      <div style={{ width: '100%', height: 122, background: '#FFE3F7', display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '0 50px' }}>
        
        {/* Logo */}
        <img style={{ width: 90, height: 80, borderRadius: '50%' }} src={logo} alt="Logo" />
        
        {/* Navigation */}
        <nav style={{ display: 'flex', gap: '40px', flexGrow: 1, justifyContent: 'center' }}>
          <div style={{ color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400' }}>Home</div>
          <div style={{ color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400' }}>Plan</div>
          <div style={{ color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400' }}>MyPage</div>
          <div style={{ color: 'black', fontSize: 16, fontFamily: 'Inter', fontWeight: '400' }}>Community</div>
        </nav>

        {/* Profile Image */}
        <div style={{ position: 'relative' }}>
          <div style={{ width: 76, height: 76, background: '#D9D9D9', borderRadius: '50%', position: 'absolute' }} />
          <img style={{ width: 54.74, height: 63.59, position: 'absolute', top: '5px', left: '10px' }} src={myImage} alt="Profile" />
        </div>
      </div>
    </header>
  );
};

export default Header;
